// show in product detail
import { Link } from "../src/Link";
export function Item({ attribute }) {
  return (
    <Link
      href={{
        pathname: "/products",
        query: { attributes: [attribute.url].toString() },
      }}
    >
      <a style={{ display: "inline-block", marginRight: 13 }}>
        {attribute.name}
      </a>
    </Link>
  );
}
